import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';

function CalendarComingSoon() {
  const navigate = useNavigate();

  return (
    <Box
      sx={{
        minHeight: 'calc(100vh - 64px)',
        background: 'linear-gradient(135deg, #0A0A0F 0%, #1a1a1f 100%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        py: 4,
        px: 3,
      }}
    >
      <motion.div
        initial={{ opacity: 0, scale: 0.8 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.5 }}
        style={{
          textAlign: 'center',
          color: '#fff',
          background: 'rgba(17, 17, 17, 0.8)',
          padding: '2rem',
          borderRadius: '12px',
          boxShadow: '0 4px 20px rgba(0, 0, 0, 0.2)',
        }}
      >
        <Typography variant="h4" sx={{ mb: 2, color: '#DC143C' }}>
          Calendar
        </Typography>
        <Typography variant="h6" sx={{ mb: 4, color: 'rgba(255, 255, 255, 0.7)' }}>
          Exciting features are on the way!
        </Typography>
        <motion.div
          initial={{ y: 10 }}
          animate={{ y: 0 }}
          transition={{
            repeat: Infinity,
            repeatType: 'reverse',
            duration: 1,
          }}
        >
          <Typography variant="body1" sx={{ mb: 4, color: 'rgba(255, 255, 255, 0.5)' }}>
            Stay tuned for our interactive calendar feature.
          </Typography>
        </motion.div>
        <motion.div
          initial={{ scale: 1.5 }}
          animate={{ scale: 1.5 }}
          transition={{
            repeat: Infinity,
            repeatType: 'reverse',
            duration: 0.8,
          }}
        >
          <Button
            variant="contained"
            onClick={() => navigate('/dashboard')}
            sx={{
              bgcolor: 'rgba(220, 20, 60, 0.8)',
              '&:hover': { bgcolor: 'rgba(220, 20, 60, 1)' },
              fontSize: '1rem',
              px: 3,
              py: 1.5,
              transition: 'transform 0.3s ease',
            }}
          >
            Back to Dashboard
          </Button>
        </motion.div>
      </motion.div>
    </Box>
  );
}

export default CalendarComingSoon;
